import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <ul>
        <li className="nav-links">
        <a href="/">Home</a>
      </li>
      <li className="nav-links">
        <a href="/ScheduleAppt">Schedule</a>
      </li>
      <li className="nav-links">
        <a href="/SignUp">Sign Up</a>
      </li>
      <li className="nav-links">
        <a href="/Login">Login</a>
      </li>
    </ul>
  );
};

export default Navbar;
